import { useLoader, Canvas } from '@react-three/fiber'
import { GLTFLoader } from 'three/examples/jsm/loaders/GLTFLoader'
import React, { Suspense, useState } from 'react'
import { Environment, OrbitControls, useGLTF } from '@react-three/drei'



function Model() {
  const { scene } = useGLTF("cup.glb", "donut48.glb");
  return (
    <primitive object={scene} />
  )
}


export function Create() {
  const [hidden, setHidden] = useState(true);
  return (
    <div>
      <div>
        {!hidden ? function ShowDonut() {
          return (
            <div style={{ height: "100vh", backgroundColor: "#fde2e4" }}>
              <Canvas camera={{ position: [10, 18, 23], fov: 0.5 }}>
                <pointLight position={[10, 10, 10]} intensity={1.3} />
                <Suspense fallback={null}>
                  <Model />
                </Suspense>
              </Canvas>
            </div>
          );
        }
          : true}
        <button onClick={() => setHidden(s => !s)}>
          Donut
        </button>
      </div>
      <div style={{ height: "80vh" }}>
        <Canvas camera={{ position: [80, -20, 23], fov: 0.5 }}>
          <Suspense fallback={null}>
            <Model />
            <OrbitControls />
            <Environment preset="night" background />
            <pointLight position={[5, 5, 5]} intensity={1.3} />
          </Suspense>
        </Canvas>
      </div>
    </div>
  );
}


